import './App.css';
import {useState, useEffect} from 'react'
import axios from 'axios';

function App() {

  const [data, setData] = useState( [] );

  useEffect( () => {
    axios.get( "http://127.0.0.1:8000/todo/" )
      .then( ( res ) => {
        setData(res.data)
      } )
      .catch( ( err ) => {
        console.log( err );
      })
  },[])

  return (
    <div className="App">
      {data.map( datas => (
        <div>
          <p>{datas.task}</p>
          <p>{datas.created}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
